import React from 'react';
import {BsChatLeftText } from 'react-icons/bs';

export default function DoctorCard(props)
{
    return(
        <div>
            {props.doctors.map((doctor)=>{
               return <Card className = 'cards' doctor = {doctor}/>
            })}
        </div>
    );
}
function Card(props)
{
    return(
        <div className='doctor-card'>
            <img  className='card-item' src='https://st2.depositphotos.com/1006318/8387/v/450/depositphotos_83877780-stock-illustration-medical-doctor-profile-icon.jpg'></img>
            <h4 className='card-item' style={{gridRow:'2'}}>{props.doctor.name}</h4>
            <span className='card-item'>{props.doctor.title}</span>
            <button className='card-item card-button'><BsChatLeftText fontSize = '1.3rem'/></button>
            
        </div>
    )
}
